(121, 'Оказание бухгалтерских услуг в Астане', 'Компании,бизнес', '-', 'Другие сферы бизнеса', '777', 'тг', 'в наличии', 'Компания «ТабысАудитКонсалтинг» на рынке бухгалтерских услуг более 13 лет. Наша профессиональная команда состоит из высококвалифицированных специалистов, которые в свою очередь имеют Сертификаты \"Профессионального Бухгалтера\", Налогового Консультанта 1-й категории и Международный Сертификат CAP. \nМы предалагем широкий спектр бухгалтерских услуг: бухгалтерский аутсорсинг, восстановление бух. учета, бухгалтерский консалтинг, сдача налоговой отчетности, статистические отчеты и многое другое. \n3 веских причины позвонить и познакомиться с нами:\n1.	Оценим реальное состояние дел в учете Вашей компании: проведем экспресс-проверку работы предыдущего бухгалтера, укажем на текущие проблемы, финансовые и налоговые риски\n2.	Вникнем реальное состояние дел в учете Вашей компании: проведем экспресс-проверку работы предыдущего бухгалтера, укажем на текущие проблемы, финансовые и налоговые риски\n3.	Посоветуем, как снизить налоговые риски и расскажем о подходящих Вам способах оптимизации налогов, чтобы с одной стороны – вы не переплачивали в бюджет, а с другой – не привлекали внимание налоговой.', 'Акмолинская область', 'Астана', 'elmira999elmira9@gmail.com', '7(721) 232-2877', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'ТОО \"Табыс Аудит Консалтинг\"', 'нет', 'нет', 'нет', 'всем', 0, 0, 0, 'нет', 'нет', 0, 0, 'нет', 'нет', 'нет', 'нет', '0', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 0, 0, 'нет', 0, 0, 0, 0, 'нет', 0, 0, 0, 0, 0, 0, 'нет', 0, 0, 0, 'нет', 0, 0, 0, 'нет', 'нет', 0, 'нет', 0, 0, 0, 'нет', 'нет', 'нет', 0, 0, 0, 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 0, 0, 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет