(188, 'РАЗРАБОТКА ДОГОВОРОВ для заказчиков со всего Казахстана', 'Услуги и обслуживание', 'Юридические услуги', 'Юридические консультации', '777', 'тг', 'в наличии', 'Более половины всех имущественных споров, рассматриваемых судами по искам граждан и субьектов предпринимательства, возникают через ошибки при заключении сделок. Другими словами – через использование типовых, зачастую «скачанных» из Интернета некачественных договоров. Каждая сделка – неповторима; соответственно, для каждой сделки нужен отдельный, специально разработанный договор. Квалифицированный юрист (более 28 лет опыта работы, магистр права, магистр психологии, экономист-маркетолог, № 3 из более чем 600 правоведов на сайте юристов Казахстана Freelawyer) предлагает индивидуальное составление и/или анализ (экспертизу) любых договоров для граждан и бизнеса: купли-продажи, поставки, дарения, аренды, оказания услуг, выполнения работ (подряда), совместной деятельности, ВЭД, брачно-семейных договоров, кадровой документации (трудовых договоров и договоров о полной материальной ответственности, должностных инструкций, обязательств о неразглашении коммерческой тайны и неконкуренци) и т.п. Отдельная «фишка»: составление в сложных ситуациях договоров, прямо не предусмотренных законодательством, но не противоречащих ему; урегулирование спорных вопросов в договорах с допустимым отступлением от предписания ГК. Составляю и корректирую договора специально под заказчика, с учетом его пожеланий и интересов. Внесите номера моих телефонов в свою электронную или бумажную записную книжку прямо сейчас: 8(778)734-86-64; 8(776)139-24-90; 8(708)861-55-79 ! Эл. почта: advokat-pavlodar@mail.ru. Обращайтесь! ', 'Алматинская область', 'Алматы', 'writer@gmail.com', '8(778) 734-8664', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', '‎Майк Молчанов‎ Facebook', 'нет', 'нет', 'нет', 'всем', 0, 0, 0, 'нет', 'нет', 0, 0, 'нет', 'нет', 'нет', 'нет', '0', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет',