(339, 'Сбор вторсырья', 'Услуги и обслуживание', '-', 'Другие услуги', '150', 'тг', 'в наличии', 'Завод по переработке ТБО, закупает на постоянной основе:\n\n1) МАКУЛАТУРА, кроме картона! – от 15 до 25 тенге\n\n(книги, журналы, газеты, списанные тиражи, офисные архивы и т.п.)\n\n2) ПЛАСТМАСС – от 15 до 100 тенге\n\n(ящики магазинные, корзинки, ведра, тазики, оконные рамы, водопроводные трубы черного цвета и т.п.)\n\n3) КАНИСТРА ПЛАСТИКОВАЯ – от 30 до 60 тенге\n\n(из-под авто масел, антифриза, других хим. жидкостей, из-под моющих средств и средств личной гигиены, бочки и другие емкости из-под химии)\n\n4) ПОЛИЭТИЛЕН – от 30 до 100 тенге\n\n(из-под любой упаковки, любого назначения).\n\n5) БАНКА алюминиевая в любом виде - от 80 до 150 тенге\n\nЗавод по переработке ТБО приглашает к сотрудничеству на постоянной основе компании и организации.\n\nМы предлагаем сервис по регулярному вывозу вашего вторсырья, гарантируем бесперебойную оплату и лучшие цены, наличную и безналичную формы расчетов. Так же уничтожаем архив или списанный тираж с гарантией конфиденциальности и безопасности.\n\nПри условии долгосрочного сотрудничества на договорной основе, цены значительно выше!\n\nНаши гарантии:\n\n1) Стабильные цены\n\n2) Своевременный самовывоз\n\n3) Взвешивание на месте\n\n4) Самостоятельная погрузка\n\n5) Незамедлительная оплата', 'Карагандинская область', 'Караганда', 'konstantin_kawada@mail.ru', '8(776) 542-4844', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'KAWADA', 'нет', 'нет', 'нет', 'всем', 0, 0, 0, 'нет', 'нет', 0, 0, 'нет', 'нет', 'нет', 'нет', '0', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 0, 0, 'нет', 0, 0, 0, 0, 'нет', 0, 0, 0, 0, 0, 0, 'нет', 0, 0, 0, 'нет', 0, 0, 0, 'нет', 'нет', 0, 'нет', 0, 0, 0, 'нет', 'нет', 'нет', 0, 0, 0, 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет