(410, 'Эндонорм', 'Услуги и обслуживание', 'Красота и здоровье', 'Медицинские услуги', '14400', 'тг', 'в наличии', 'Эндонорм- в лечении заболеваний щитовидной железы.\nЭндонорм- высокоэффективный натуральный препарат для восстановления структуры и функции щитовидной железы.\nОсновное действующее вещество - растительный гликозид Альбинин, обладающий тиреотропной и гонадотропной активностью.\nСостав:\n- Экстракт Лапчатки белой (экстракт корней и корневищ ) - источник Альбинина.\n- Экстракт Череды трехраздельной -имуномодулирующее действие.\n- Экстракт корней Солодки голой - противосполительный ,противоотечный , мембраностабилизирующий эффект.\n- Ламинария сахаристая - источник биологического йода.\nБезопасен в применении- отсутствуют выраженные побочные действия;\nЭффективен при лечении заболеваний, ранее принципиально не подававшихся медикаментозному и консервативному лечению ( аутоимунныйтиреоидит. Узловой/многоузловой зоб).\n\nПоказания:\n-Аутоимунныйтиреоидит \n-Гипо и гипертиреоз\n-Эндемический зоб( диффузный , узловой, многоузловой)\n-Эутироидный зоб ( диффузный,узловой, многоузловой\n-Гиперпластические процессы женской репродуктивной системы\n-Климактерический синдром, ПМС ,альгодисменорея.\nПротивопоказания: \nИндивидуальная непереносимость компонентов препарата, острые воспалительные заболевания пищеварительной системы, беременность и период лактации, детский возраст до 12 лет.\nЮридически не является лекарством. Бад.\n', 'Акмолинская область', 'Астана', '87086781583@mail.ru', '8(708) 678-1583', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'Дарья', 'нет', 'нет', 'нет', 'нет', 'всем', 0, 0, 0, 'нет', 'нет', 0, 0, 'нет', 'нет', 'нет', 'нет', '0', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 'нет', 0, 0, 'нет', 0, 0, 0, 0, 'нет', 0, 0, 0, 0, 0, 0, 'нет', 0, 0, 0, 'нет', 0, 0, 0, 'нет', 'нет', 0, 'нет', 